import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Cv } from '../models/cv.model';
@Injectable({
  providedIn: 'root'
})
export class CvService {
  const baseUrl = 'http://localhost:8080/api/cvs';


  constructor(private http: HttpClient) { }
  getAll(): Observable<Cv[]> {
    return this.http.get<Cv[]>(baseUrl);
  }
  get(id: any): Observable<Cv> {
    return this.http.get(`${baseUrl}/${id}`);
  }

  create(data: any): Observable<any> {
    return this.http.post(baseUrl, data);
  }

  update(id: any, data: any): Observable<any> {
    return this.http.put(`${baseUrl}/${id}`, data);
  }


  delete(id: any): Observable<any> {
    return this.http.delete(`${baseUrl}/${id}`);
  }
  getCvById(cvId: any): Observable<Cv|undefined> {
    const url = `${this.baseUrl}/${cvId}`;
    return this.http.get<Cv>(url);
  }




}
